import React from 'react';
import ReactPlayer from 'react-player';

const Player = () => {
    const [audioUrl, setAudioUrl] = useState('');

    const handleUrlChange = (event) => {
        setAudioUrl(event.target.value);
      };    

  return (
    <div className="audio-player">
      <ReactPlayer
        url={audioUrl}
        controls
        width="100%"
        height="60px"
      />
    </div>
  );
};

export default Player;
